import { BrowserRouter} from "react-router-dom";
import AppRoutes from "./components/AppRoutes";
import MenuBar from "./components/MenuBar";
import { LoggedUserContext } from "./context/LoggedUserContext.Js";

function App() {

  return (
      <BrowserRouter>
        <LoggedUserContext.Provider
            value={{
              loggedUser,
              setLoggedUser,
            }}
          >
        <MenuBar />
        <AppRoutes/>
        </LoggedUserContext.Provider>
      </BrowserRouter>
  );
}

export default App;
